INSERT INTO supabase_migrations.schema_migrations (version, statements, name, created_by, idempotency_key) VALUES ('20250605091853', '{"-- Fix the bulk_delete_manuals function to properly return results
CREATE OR REPLACE FUNCTION bulk_delete_manuals(manual_ids UUID[])
RETURNS TABLE(deleted_count INTEGER, affected_rows UUID[])
LANGUAGE plpgsql
AS $$
DECLARE
    _deleted_count INTEGER;
    _affected_rows UUID[];
BEGIN
    -- Update multiple documents in a single transaction
    UPDATE documents 
    SET 
        is_deleted = true,
        deleted_at = NOW()
    WHERE 
        id = ANY(manual_ids)
        AND document_type = ''manual''
        AND is_deleted = false
    RETURNING id INTO _affected_rows;
    
    -- Get count of affected rows
    GET DIAGNOSTICS _deleted_count = ROW_COUNT;
    
    -- Return the results
    RETURN QUERY SELECT _deleted_count, _affected_rows;
END;
$$;"}', 'fix_bulk_delete_manuals_function', 'mahmoud.m.gabr@gmail.com', NULL);
INSERT INTO supabase_migrations.schema_migrations (version, statements, name, created_by, idempotency_key) VALUES ('20250605091918', '{"-- Fix the bulk_delete_manuals function to properly collect multiple returning rows
CREATE OR REPLACE FUNCTION bulk_delete_manuals(manual_ids UUID[])
RETURNS TABLE(deleted_count INTEGER, affected_rows UUID[])
LANGUAGE plpgsql
AS $$
DECLARE
    _deleted_count INTEGER;
    _affected_rows UUID[];
BEGIN
    -- Update multiple documents in a single transaction and collect all returned IDs
    WITH updated_docs AS (
        UPDATE documents 
        SET 
            is_deleted = true,
            deleted_at = NOW()
        WHERE 
            id = ANY(manual_ids)
            AND document_type = ''manual''
            AND is_deleted = false
        RETURNING id
    )
    SELECT array_agg(id), count(*)::INTEGER 
    INTO _affected_rows, _deleted_count
    FROM updated_docs;
    
    -- Handle case where no rows were affected
    IF _deleted_count IS NULL THEN
        _deleted_count := 0;
        _affected_rows := ARRAY[]::UUID[];
    END IF;
    
    -- Return the results
    RETURN QUERY SELECT _deleted_count, _affected_rows;
END;
$$;"}', 'fix_bulk_delete_manuals_function_v2', 'mahmoud.m.gabr@gmail.com', NULL);
