INSERT INTO supabase_migrations.schema_migrations (version, statements, name, created_by, idempotency_key) VALUES ('20250605100934', '{"-- Fix the document_sections RLS policy to allow access to sections of documents with null organization_id
DROP POLICY IF EXISTS \"document_sections_policy\" ON document_sections;

CREATE POLICY \"document_sections_policy\" ON document_sections
FOR ALL
TO public
USING (
  EXISTS (
    SELECT 1 
    FROM documents d 
    LEFT JOIN users u ON (d.organization_id = u.organization_id AND u.id = auth.uid())
    WHERE document_sections.document_id = d.id 
    AND (
      u.id IS NOT NULL OR  -- User belongs to same organization
      d.organization_id IS NULL  -- Document has no organization (public/orphaned)
    )
  )
);"}', 'fix_document_sections_rls_policy', 'mahmoud.m.gabr@gmail.com', NULL);
INSERT INTO supabase_migrations.schema_migrations (version, statements, name, created_by, idempotency_key) VALUES ('20250605103703', '{"-- Create tables to support systematic IOSA parser improvement tracking

