INSERT INTO supabase_migrations.schema_migrations (version, statements, name, created_by, idempotency_key) VALUES ('20250605104349', '{"-- ==============================================================================
-- IOSA PARSER IMPROVEMENT DASHBOARD VIEWS
-- ==============================================================================

-- View 1: Iteration Summary with computed duration
CREATE OR REPLACE VIEW dashboard_iteration_summary AS
SELECT 
    iteration_number,
    target_accuracy,
    training_accuracy,
    validation_accuracy,
    (training_accuracy - validation_accuracy) as accuracy_gap,
    precision_score,
    recall_score,
    f1_score,
    overfitting_detected,
    underfitting_detected,
    status,
    EXTRACT(EPOCH FROM (completed_at - created_at))/60 as duration_minutes,
    created_at,
    completed_at
FROM iosa_improvement_iterations
ORDER BY iteration_number DESC;

-- View 2: Training Progress
CREATE OR REPLACE VIEW dashboard_training_progress AS
SELECT 
    i.iteration_number,
    e.epoch_number,
    e.training_accuracy,
    e.validation_accuracy,
    e.precision_score,
    e.recall_score,
    e.f1_score,
    e.training_loss,
    e.early_stopping_triggered,
    e.created_at
FROM iosa_improvement_iterations i
JOIN iosa_training_epochs e ON i.id = e.iteration_id
ORDER BY i.iteration_number DESC, e.epoch_number;

-- View 3: Sample Performance Analysis
CREATE OR REPLACE VIEW dashboard_sample_performance AS
SELECT 
    b.sample_name,
    b.sample_category,
    b.sections_count as ground_truth_sections,
    COUNT(DISTINCT r.iteration_id) as evaluations_count,
    AVG(r.accuracy) as avg_accuracy,
    AVG(r.precision_score) as avg_precision,
    AVG(r.recall_score) as avg_recall,
    AVG(r.f1_score) as avg_f1,
    AVG(r.confidence_score) as avg_confidence,
    MIN(r.accuracy) as min_accuracy,
    MAX(r.accuracy) as max_accuracy,
    STDDEV(r.accuracy) as accuracy_std
FROM iosa_sample_benchmarks b
LEFT JOIN iosa_sample_results r ON b.id = r.sample_id
GROUP BY b.sample_name, b.sample_category, b.sections_count
ORDER BY avg_accuracy DESC NULLS LAST;

-- View 4: Current Status Overview
CREATE OR REPLACE VIEW dashboard_current_status AS
SELECT 
    (SELECT COUNT(*) FROM iosa_improvement_iterations WHERE status = ''completed'') as completed_iterations,
    (SELECT COUNT(*) FROM iosa_improvement_iterations WHERE status = ''running'') as running_iterations,
    (SELECT COUNT(*) FROM iosa_improvement_iterations WHERE status = ''failed'') as failed_iterations,
    (SELECT MAX(validation_accuracy) FROM iosa_improvement_iterations WHERE status = ''completed'') as best_accuracy,
    (SELECT COUNT(*) FROM iosa_sample_benchmarks) as total_samples,
    (SELECT COUNT(*) FROM iosa_sample_benchmarks WHERE data_split = ''training'') as training_samples,
    (SELECT COUNT(*) FROM iosa_sample_benchmarks WHERE data_split = ''validation'') as validation_samples,
    (SELECT COUNT(*) FROM iosa_model_configs WHERE is_best_model = true) as best_models,
    (SELECT COUNT(*) FROM iosa_training_epochs) as total_epochs_trained,
    (SELECT COUNT(*) FROM iosa_improvement_errors WHERE resolved = false) as unresolved_errors;

-- View 5: Model Health Analysis  
CREATE OR REPLACE VIEW dashboard_model_health AS
SELECT 
    CASE 
        WHEN overfitting_detected THEN ''Overfitting''
        WHEN underfitting_detected THEN ''Underfitting''
        ELSE ''Healthy''
    END as model_health,
    COUNT(*) as occurrences,
    AVG(training_accuracy) as avg_training_acc,
    AVG(validation_accuracy) as avg_validation_acc,
    AVG(training_accuracy - validation_accuracy) as avg_gap,
    STRING_AGG(DISTINCT improvement_applied, ''; '') as applied_improvements
FROM iosa_improvement_iterations
WHERE status = ''completed''
GROUP BY 
    CASE 
        WHEN overfitting_detected THEN ''Overfitting''
        WHEN underfitting_detected THEN ''Underfitting''
        ELSE ''Healthy''
    END
ORDER BY occurrences DESC;

-- View 6: Latest Iteration Details
CREATE OR REPLACE VIEW dashboard_latest_iteration AS
WITH latest_iteration AS (
    SELECT id, iteration_number 
    FROM iosa_improvement_iterations 
    WHERE status = ''completed'' 
    ORDER BY iteration_number DESC 
    LIMIT 1
)
SELECT 
    i.iteration_number,
    i.training_accuracy,
    i.validation_accuracy,
    i.precision_score,
    i.recall_score,
    i.f1_score,
    i.status,
    (SELECT COUNT(*) FROM iosa_training_epochs e WHERE e.iteration_id = i.id) as epochs_completed,
    (SELECT AVG(accuracy) FROM iosa_sample_results r WHERE r.iteration_id = i.id) as avg_sample_accuracy,
    (SELECT COUNT(*) FROM iosa_sample_results r WHERE r.iteration_id = i.id AND r.accuracy >= 90) as high_accuracy_samples,
    i.created_at,
    i.completed_at
FROM latest_iteration li
JOIN iosa_improvement_iterations i ON li.id = i.id;"}', 'create_iosa_dashboard_views', 'mahmoud.m.gabr@gmail.com', NULL);
INSERT INTO supabase_migrations.schema_migrations (version, statements, name, created_by, idempotency_key) VALUES ('20250608080629', '{"-- Add parser_type column to regulation_sections table
