    admin_user_id UUID;
BEGIN
    SELECT id INTO admin_user_id FROM public.users WHERE role = ''admin'' LIMIT 1;
    
    IF admin_user_id IS NOT NULL THEN
        UPDATE public.audits SET created_by = admin_user_id WHERE created_by IS NULL;
        UPDATE public.documents SET created_by = admin_user_id WHERE created_by IS NULL;
        UPDATE public.findings SET created_by = admin_user_id WHERE created_by IS NULL;
