INSERT INTO supabase_migrations.schema_migrations (version, statements, name, created_by, idempotency_key) VALUES ('20250608065058', '{"-- User-Level Data Isolation Migration for PDF Processing System
-- This migration adds user_id fields and RLS policies to ensure data isolation

-- 1. Add user_id to pdf_results table (main gap)
ALTER TABLE pdf_results 
ADD COLUMN user_id UUID REFERENCES auth.users(id);

-- 2. Add user_id to pdf_sections table 
ALTER TABLE pdf_sections
ADD COLUMN user_id UUID REFERENCES auth.users(id);

-- 3. Add user_id to regulation_sections table (for processed PDF content)
ALTER TABLE regulation_sections
ADD COLUMN user_id UUID REFERENCES auth.users(id);

-- 4. Enable Row Level Security on all PDF tables
ALTER TABLE pdf_jobs ENABLE ROW LEVEL SECURITY;
ALTER TABLE pdf_results ENABLE ROW LEVEL SECURITY;
ALTER TABLE pdf_sections ENABLE ROW LEVEL SECURITY;

-- 5. Create RLS policies for pdf_jobs (created_by field already exists)
CREATE POLICY \"Users can only access their own PDF jobs\" ON pdf_jobs
FOR ALL USING (auth.uid() = created_by);

-- 6. Create RLS policies for pdf_results
CREATE POLICY \"Users can only access their own PDF results\" ON pdf_results
FOR ALL USING (auth.uid() = user_id);

-- 7. Create RLS policies for pdf_sections  
CREATE POLICY \"Users can only access their own PDF sections\" ON pdf_sections
FOR ALL USING (auth.uid() = user_id);

-- 8. Create RLS policies for regulation_sections (when user_id is set)
CREATE POLICY \"Users can only access their own regulation sections\" ON regulation_sections
FOR ALL USING (user_id IS NULL OR auth.uid() = user_id);

-- 9. Create indexes for performance on user_id fields
CREATE INDEX idx_pdf_results_user_id ON pdf_results(user_id);
CREATE INDEX idx_pdf_sections_user_id ON pdf_sections(user_id);
CREATE INDEX idx_regulation_sections_user_id ON regulation_sections(user_id);
CREATE INDEX idx_pdf_jobs_created_by ON pdf_jobs(created_by);

-- 10. Update existing records to set user_id (will be null for legacy data)
-- Note: This is safe as RLS policies handle null values appropriately

-- 11. Create a function to automatically set user_id for new PDF jobs
CREATE OR REPLACE FUNCTION set_pdf_job_user_id()
RETURNS TRIGGER AS $$
BEGIN
  NEW.created_by = auth.uid();
  RETURN NEW;
END;
$$ LANGUAGE plpgsql SECURITY DEFINER;

-- 12. Create trigger to auto-set user_id on PDF job creation
CREATE TRIGGER pdf_jobs_set_user_id
  BEFORE INSERT ON pdf_jobs
  FOR EACH ROW
  EXECUTE FUNCTION set_pdf_job_user_id();

-- 13. Create audit log trigger for user activity tracking
CREATE OR REPLACE FUNCTION log_pdf_activity()
RETURNS TRIGGER AS $$
BEGIN
  INSERT INTO activity_logs (user_id, action, entity_type, entity_id, details)
  VALUES (
    auth.uid(),
    TG_OP,
    ''pdf_job'',
    COALESCE(NEW.id, OLD.id),
    jsonb_build_object(
      ''filename'', COALESCE(NEW.filename, OLD.filename),
      ''status'', COALESCE(NEW.status, OLD.status),
      ''timestamp'', NOW()
    )
  );
  RETURN COALESCE(NEW, OLD);
END;
$$ LANGUAGE plpgsql SECURITY DEFINER;

-- 14. Create audit triggers
CREATE TRIGGER pdf_jobs_audit_log
  AFTER INSERT OR UPDATE OR DELETE ON pdf_jobs
  FOR EACH ROW
  EXECUTE FUNCTION log_pdf_activity();

-- 15. Grant necessary permissions for service role operations
GRANT ALL ON pdf_jobs TO service_role;
GRANT ALL ON pdf_results TO service_role;  
GRANT ALL ON pdf_sections TO service_role;
GRANT ALL ON regulation_sections TO service_role;"}', 'add_user_isolation_to_pdf_system', 'mahmoud.m.gabr@gmail.com', NULL);
INSERT INTO supabase_migrations.schema_migrations (version, statements, name, created_by, idempotency_key) VALUES ('20250609122256', '{"-- Add missing columns for API compatibility
-- 1. Add title column to findings table
ALTER TABLE findings ADD COLUMN IF NOT EXISTS title TEXT;

-- 2. Add filename column to documents table (use existing document_name)  
ALTER TABLE documents ADD COLUMN IF NOT EXISTS filename TEXT;

-- 3. Add type column to regulations table
ALTER TABLE regulations ADD COLUMN IF NOT EXISTS type TEXT DEFAULT ''aviation_regulation'';

-- Update existing data to populate new columns
-- For documents: copy document_name to filename where filename is null
UPDATE documents SET filename = document_name WHERE filename IS NULL AND document_name IS NOT NULL;

-- For documents: copy title to filename where both are null
UPDATE documents SET filename = title WHERE filename IS NULL AND title IS NOT NULL;

-- For findings: generate title from compliance_status and details
UPDATE findings SET title = 
  CASE 
    WHEN compliance_status IS NOT NULL AND details IS NOT NULL THEN 
      compliance_status || '': '' || LEFT(details, 50) || CASE WHEN LENGTH(details) > 50 THEN ''...'' ELSE '''' END
    WHEN compliance_status IS NOT NULL THEN compliance_status
    WHEN details IS NOT NULL THEN LEFT(details, 100)
    ELSE ''Finding '' || id::text
  END
WHERE title IS NULL;

-- For regulations: set type based on existing category or authority
UPDATE regulations SET type = 
  CASE 
    WHEN title ILIKE ''%IOSA%'' OR title ILIKE ''%audit%'' THEN ''audit_standard''
    WHEN title ILIKE ''%GACAR%'' OR title ILIKE ''%civil%'' THEN ''civil_aviation_regulation''
    WHEN title ILIKE ''%ECAR%'' OR title ILIKE ''%european%'' THEN ''european_regulation''
    ELSE ''aviation_regulation''
  END
WHERE type IS NULL OR type = ''aviation_regulation'';"}', 'add_missing_columns_for_api_compatibility', 'mahmoud.m.gabr@gmail.com', NULL);
