INSERT INTO supabase_migrations.schema_migrations (version, statements, name, created_by, idempotency_key) VALUES ('20250615080843', '{"-- Add deprecation comments to old tables
COMMENT ON TABLE pdf_sections IS ''DEPRECATED: Use unified_sections table instead. This table will be removed in a future version.'';
COMMENT ON TABLE regulation_sections IS ''DEPRECATED: Use unified_sections table instead. This table will be removed in a future version.'';
COMMENT ON TABLE document_sections IS ''DEPRECATED: Use unified_sections table instead. This table will be removed in a future version.'';
COMMENT ON TABLE manual_sections IS ''DEPRECATED: Use unified_sections table instead. This table will be removed in a future version.'';

-- Create a view that shows the migration mapping
CREATE OR REPLACE VIEW section_table_migration_guide AS
SELECT 
    ''pdf_sections'' as old_table,
    ''unified_sections'' as new_table,
    ''source_type = ''''pdf_extraction'''''' as filter_condition,
    ''Maps job_id -> source_job_id, section_title -> title, section_content -> content'' as field_mapping
UNION ALL
SELECT 
    ''regulation_sections'' as old_table,
    ''unified_sections'' as new_table,
    ''source_type = ''''regulation_import'''''' as filter_condition,
    ''Maps regulation_id -> source_document_id, section_name -> section_name, full_text -> content'' as field_mapping
UNION ALL
SELECT 
    ''document_sections'' as old_table,
    ''unified_sections'' as new_table,
    ''source_type = ''''document_upload'''''' as filter_condition,
    ''Maps document_id -> source_document_id, section_name -> section_name, full_text -> content'' as field_mapping
UNION ALL
SELECT 
    ''manual_sections'' as old_table,
    ''unified_sections'' as new_table,
    ''source_type = ''''manual_creation'''''' as filter_condition,
    ''Maps manual_id -> source_document_id, section_name -> section_name, content -> content'' as field_mapping;

-- Create a function to migrate data from old tables to unified_sections
CREATE OR REPLACE FUNCTION migrate_sections_to_unified()
RETURNS TABLE(
    migrated_table TEXT,
    records_migrated INTEGER,
    success BOOLEAN,
    error_message TEXT
) AS $$
DECLARE
    pdf_count INTEGER := 0;
    reg_count INTEGER := 0;
    doc_count INTEGER := 0;
    man_count INTEGER := 0;
BEGIN
    -- This function can be called when ready to migrate existing data
    -- For now, just return the counts of what would be migrated
    
    SELECT COUNT(*) INTO pdf_count FROM pdf_sections;
    SELECT COUNT(*) INTO reg_count FROM regulation_sections;
    SELECT COUNT(*) INTO doc_count FROM document_sections;
    SELECT COUNT(*) INTO man_count FROM manual_sections;
    
    RETURN QUERY VALUES 
        (''pdf_sections'', pdf_count, true, ''Ready to migrate''),
        (''regulation_sections'', reg_count, true, ''Ready to migrate''),
        (''document_sections'', doc_count, true, ''Ready to migrate''),
        (''manual_sections'', man_count, true, ''Ready to migrate'');
END;
$$ LANGUAGE plpgsql;"}', 'deprecate_redundant_section_tables', 'mahmoud.m.gabr@gmail.com', NULL);
