INSERT INTO supabase_migrations.schema_migrations (version, statements, name, created_by, idempotency_key) VALUES ('20250615081812', '{"-- STEP 1: Since manuals table is deprecated and documents is the primary table,
-- let''s ensure documents table properly handles organization relationships

-- First, let''s see if there''s any data in manuals that needs to be migrated
-- (We''ll check this before proceeding)

-- STEP 2: Make organization_id NOT NULL in documents table (after ensuring data integrity)
-- But first, let''s set a default organization for any documents without one

-- Get the first organization ID to use as default
DO $$
DECLARE
    default_org_id UUID;
BEGIN
    -- Get the first organization ID
    SELECT id INTO default_org_id FROM organizations LIMIT 1;
    
    -- Update any documents without organization_id
    IF default_org_id IS NOT NULL THEN
        UPDATE documents 
        SET organization_id = default_org_id 
        WHERE organization_id IS NULL;
        
        RAISE NOTICE ''Updated % documents with default organization_id: %'', 
            (SELECT COUNT(*) FROM documents WHERE organization_id = default_org_id), 
            default_org_id;
    END IF;
END $$;

-- STEP 3: Now make organization_id required in documents
ALTER TABLE documents 
ALTER COLUMN organization_id SET NOT NULL;

-- STEP 4: Add proper indexing for organization relationships
CREATE INDEX IF NOT EXISTS idx_documents_organization_id ON documents(organization_id);
CREATE INDEX IF NOT EXISTS idx_documents_organization_type ON documents(organization_id, document_type);

-- STEP 5: Add comments explaining the consolidated approach
COMMENT ON COLUMN documents.organization_id IS ''Required organization ID - all documents must belong to an organization. This replaces the need for separate manual/document organization tracking.'';
COMMENT ON TABLE documents IS ''Unified table for all document types (manuals, regulations, procedures, policies, etc.) with required organization relationship. Replaces the redundant manuals table completely.'';"}', 'consolidate_documents_manuals_organization_relationship', 'mahmoud.m.gabr@gmail.com', NULL);
INSERT INTO supabase_migrations.schema_migrations (version, statements, name, created_by, idempotency_key) VALUES ('20250615081845', '{"-- STEP 1: Create a migration function to move any manual data to documents
CREATE OR REPLACE FUNCTION migrate_manuals_to_documents_with_organization()
RETURNS TABLE(migrated_count INTEGER, organization_assignments TEXT) AS $$
DECLARE
    manual_record RECORD;
    default_org_id UUID;
    migrated_count INTEGER := 0;
    org_assignments TEXT := '''';
BEGIN
    -- Get a default organization
    SELECT id INTO default_org_id FROM organizations LIMIT 1;
    
    -- Migrate any existing manual records to documents
    FOR manual_record IN 
        SELECT * FROM manuals WHERE is_deleted = false OR is_deleted IS NULL
    LOOP
        -- Insert into documents table with proper organization
        INSERT INTO documents (
            title,
            description,
            document_type,
            status,
            organization_id,  -- This is the key addition
            file_url,
            metadata,
            created_by,
            created_at,
            updated_at,
            version,
            manual_type
        ) VALUES (
            manual_record.manual_name,
            ''Migrated from manuals table'',
            ''manual'',
            manual_record.status::text,
            COALESCE(
                -- Try to get organization from user if available
                (SELECT organization_id FROM users WHERE id = manual_record.user_id),
                -- Otherwise use default organization
                default_org_id
            ),
            NULL, -- file_url
            manual_record.metadata,
            manual_record.user_id,
            manual_record.created_at,
            manual_record.updated_at,
            manual_record.version::text,
            manual_record.category
        );
        
        migrated_count := migrated_count + 1;
        org_assignments := org_assignments || format(''Manual \"%s\" -> Org: %s; '', 
            manual_record.manual_name, 
            COALESCE(
                (SELECT organization_id FROM users WHERE id = manual_record.user_id),
                default_org_id
            )
        );
    END LOOP;
    
    RETURN QUERY SELECT migrated_count, org_assignments;
END;
$$ LANGUAGE plpgsql;

-- STEP 2: Run the migration
SELECT * FROM migrate_manuals_to_documents_with_organization();

-- STEP 3: Mark manuals table as fully deprecated
COMMENT ON TABLE manuals IS ''DEPRECATED AND CONSOLIDATED: This table has been fully replaced by the documents table with proper organization relationships. All manual data should now be stored in documents table with document_type=''''manual'''' and required organization_id. This table will be removed in a future version.'';"}', 'fix_manuals_consolidated_view', 'mahmoud.m.gabr@gmail.com', NULL);
INSERT INTO supabase_migrations.schema_migrations (version, statements, name, created_by, idempotency_key) VALUES ('20250615081856', '{"-- Create a view for backward compatibility (if needed)
