INSERT INTO supabase_migrations.schema_migrations (version, statements, name, created_by, idempotency_key) VALUES ('20250616073340', '{"-- Auto-fix regulation_id based on filename patterns
-- This trigger will automatically set regulation_id for jobs with specific filename patterns

CREATE OR REPLACE FUNCTION auto_fix_regulation_id()
RETURNS TRIGGER AS $$
BEGIN
    -- If regulation_id is null but filename suggests it''s a regulation job
    IF NEW.regulation_id IS NULL AND (
        NEW.filename ILIKE ''%regulation%'' OR 
        NEW.filename ILIKE ''%IOSA%'' OR
        NEW.filename ILIKE ''%test%regulation%''
    ) THEN
        -- Set to our test regulation ID for IOSA-related jobs
        IF NEW.filename ILIKE ''%IOSA%'' OR NEW.filename ILIKE ''%test%regulation%'' THEN
            NEW.regulation_id = ''56ba0502-0bf6-4cda-a6bc-dfeab6d50609'';
            RAISE NOTICE ''AUTO-FIX: Set regulation_id to test regulation for filename: %'', NEW.filename;
        END IF;
    END IF;
    
    RETURN NEW;
END;
$$ LANGUAGE plpgsql;

-- Create the auto-fix trigger that runs BEFORE our debug trigger
DROP TRIGGER IF EXISTS auto_fix_regulation_id_trigger ON pdf_jobs;
CREATE TRIGGER auto_fix_regulation_id_trigger
    BEFORE INSERT ON pdf_jobs
    FOR EACH ROW
    EXECUTE FUNCTION auto_fix_regulation_id();"}', 'auto_fix_regulation_id_from_filename', 'mahmoud.m.gabr@gmail.com', NULL);
INSERT INTO supabase_migrations.schema_migrations (version, statements, name, created_by, idempotency_key) VALUES ('20250615081916', '{"-- Create a comprehensive view showing organization-document relationships
CREATE OR REPLACE VIEW organization_documents_summary AS
SELECT 
    o.id as organization_id,
    o.name as organization_name,
    o.iata_code,
    o.icao_code,
    o.country,
    COUNT(d.id) as total_documents,
    COUNT(CASE WHEN d.document_type = ''manual'' THEN 1 END) as manual_count,
    COUNT(CASE WHEN d.document_type = ''regulation'' THEN 1 END) as regulation_count,
    COUNT(CASE WHEN d.document_type = ''procedure'' THEN 1 END) as procedure_count,
    COUNT(CASE WHEN d.document_type = ''policy'' THEN 1 END) as policy_count,
